const EndGameScreen = ({ setGameStatus, win }) => {
  return (
    <div className="EndGameScreen">
      {win?
      <h3>You win</h3>
      :
      <h3>You lose</h3>
      }
      <span>Play again</span>
    </div>
  );
}

export default EndGameScreen;
